// App.js
import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <section id="overview" className="section">
          <h2>Overview</h2>
          <p>This is the overview section of your portfolio.</p>
        </section>
        <section id="projects" className="section">
          <h2>Projects</h2>
          <p>This is the projects section of your portfolio.</p>
        </section>
        <section id="about" className="section">
          <h2>About</h2>
          <p>This is the about section of your portfolio.</p>
        </section>
        <section id="contact" className="section">
          <h2>Contact Info</h2>
          <p>This is the contact info section of your portfolio.</p>
        </section>
      </div>
    </div>
  );
}

function Navbar() {
  return (
    <nav className="navbar">
      <ul>
        <li><a href="#overview">Overview</a></li>
        <li><a href="#projects">Projects</a></li>
        <li><a href="#about">About</a></li>
        <li><a href="#contact">Contact Info</a></li>
      </ul>
    </nav>
  );
}

export default App;
